angular.module("$actionButton").run(["$templateCache", function($templateCache) {$templateCache.put("template.html","<div ng-animate-children=\"true\">\r\n	<div class=\"action-button-small-container\" ng-click=\"$ctrl.closeMenu({type: \'main\', backgroundClick: true})\" ng-style=\"{\'padding-bottom\':$ctrl.options.menuBottom}\">\r\n		<div class=\"action-button-small-container--individual\" ng-repeat=\"button in $ctrl.options.buttons\" ng-click=\"$ctrl.buttonClicked({ngEvent:$event, type: \'secondary\', index: $index})\">\r\n			<span class=\"action-button-small--label\" ng-if=\"button.label\">{{button.label}}</span>\r\n			<button ng-attr-id=\"{{button.id}}\" class=\"action-button-small\" ng-class=\"{\'destructive\': button.destructive}\">\r\n				<i class=\"action-button-small--icon icon\" ng-class=\"button.icon\"><span class=\"action-button-small--icon__label\" ng-if=\"!button.icon\">{{button.letter || button.label[0]}}</span></i>\r\n			</button>\r\n		</div>\r\n	</div>\r\n	<button ng-attr-id=\"{{$ctrl.options.mainAction.id}}\" class=\"action-button\" ng-click=\"$ctrl.buttonClicked({ngEvent:$event, type: \'main\'})\" ng-style=\"{bottom:$ctrl.options.bottom}\">\r\n		<i class=\'action-button--icon icon action-button--icon__main\' ng-class=\"$ctrl.options.mainAction.icon\"></i>\r\n		<i class=\'action-button--icon action-button-icon__close\' ng-class=\"$ctrl.options.mainAction.closeIcon\"></i>\r\n	</button>\r\n</div>\r\n");}]);